import React from 'react';
import styles from './Messages.module.css';
import MessegesAndrey from './MessegesAndrey/MessegesAndrey';
import { NavLink } from 'react-router-dom';
import { Route, BrowserRouter } from 'react-router-dom';
import MessegesShaha from './MessegesShaha/MessegesShaha';

function Messages() {
    return (
      <div>
        <h4 className={styles.headline}>Messages</h4>
        <div className={styles.messages}>
            <ul className={styles.dialogs}>
              <li><NavLink to='/messages/andrey'>Andrey</NavLink></li>
              <li><NavLink to='/messages/shaha'>Shaha</NavLink></li>
              <li><NavLink to='/messages/vlad'>Vlad</NavLink></li>
              <li><NavLink to='/messages/denis'>Denis</NavLink></li>
              <li><NavLink to='/messages/daniil'>Daniil</NavLink></li>
              <li><NavLink to='/messages/oleg'>Oleg</NavLink></li>
            </ul>
            <Route path='/messages/andrey' component={MessegesAndrey}/>
            <Route path='/messages/shaha' component={MessegesShaha}/>
        </div>
      </div>
    )
  }

export default Messages;
